script: |
  super -f text -I q10489.spq | sort > q10489.out

inputs:
  - name: q10489.spq
    data: |
      SELECT DISTINCT - + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE col2 / - 9 + - 61 + + col0 * col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q10489.out
    data: |
      -10
      -47
      -99
